import React, { Component } from 'react'
export default class nus_background extends Component {
    render() {
        return (
            <div className = "nus_background">
                <footer style ={footStyle}>
                    <h6>Welcome to NUS</h6>
                </footer>
            </div>
        )
    }
}

const footStyle = {
    color: '#000000',
    textAlign: 'center',
    padding: '10px',
}
